import React from 'react';
import Category from "./Category";

const Cartegories = () => {
    const margin = {
        width: "2%"
    }
    return (
        <div className="row">
            <Category text="common"></Category>
            <div style={margin}></div>
            <Category text="common"></Category>
            <div style={margin}></div>
            <Category text="common"></Category>
            <div style={margin}></div>
            <Category text="common"></Category>
        </div>
    );
};

export default Cartegories;
